import React,{ Component } from "react";
class User extends Component {
    render() { 
        const {myArRslt}=this.props;
        const myVar=myArRslt.map(e =>{
            return(
                <div>
                    
                    <h1>{e.name}</h1>
                    <h1>{e.age}</h1>
                    <h1>{e.salair}</h1>
                </div>
            )
        }) 
        return ( 
           <div className="App">
           {myVar}
           </div>
         );
    }
}
 
export default User;
